  \"2015-01-30T22:03:21.157036\",\n\t\"name\": \"oregon-new-markets-tax-credit-nmtc-program-2014-update-1-26-15-bc90e\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"(1.26.15 update) The Oregon Low Income
  Community Jobs Initiative (Oregon New Markets Tax Credit, or NMTC) program helps
  finance investments and create jobs in low-income communities; delivers below-market-rate
  investment options to Oregon businesses; attracts additional Federal New Market
  Tax Credit investments in Oregon; and sparks revitalization in Oregonu2019s low-income
  communities. The program is available to Community Development Entities (CDEs) serving
  Oregon that have been allocated Federal New Market Tax Credits. The Oregon new market
  tax credits are then provided to investors who make qualified equity investments
  in community development entities that in turn invest in projects located in low-income
  communities. Investments can only be made in qualified, existing low-income community
  businesses located in Oregon as defined by section 45D of the Internal Revenue Code.
  If you have additional questions, please contact Laura Engstrom at laura.engstrom@oregon.gov\",\n\t\"license_title\":
